#!/usr/local/bin/perl

package SPDI;

use strict;
use warnings;
use Carp;
use Config::Tiny;

sub new
{
    my $class = shift;

    my $sars2RefSeq = GetRefSequence();
    my @sars2RefNucs = split //, $sars2RefSeq;

    my $self = {
		_ref_nucs => \@sars2RefNucs,
		_genome_len => $#sars2RefNucs + 1,
	       };


    bless ($self, $class);

    return $self;
}

#
# Convert one indel to SPDI
#
# Input:  an indel with pos ($oPos), ref ($oRef), alt ($oAlt)
# Output: converted indel with pos ($outPos), ref ($outRef), alt ($outAlt)
#
#   If indel cannot be converted: $outPos = 0, $outRef = '', $outAlt = '',
#   and error message is saved to 4th returned value $err.
#
sub ConvertIndelToSPDI
{
    my ($self, $oPos, $oRef, $oAlt, $debug) = @_;

    $oRef = "" if ($oRef eq "-");
    $oAlt = "" if ($oAlt eq "-");

    my ($pos, $ref, $alt) = ($oPos, $oRef, $oAlt);
    my $err = "";

    print "Checking mutation pos $oPos ref $oRef alt $oAlt\n" if ($debug);

    my @refSeq = split //, $oRef;
    my @altSeq = split //, $oAlt;

    if ($oPos < 1 || $oPos > $self->{_genome_len}) {
        $err = "Invalid pos $oPos";
        return (0, "", "", $err);
    }

    # Make sure input ref and alt are string of A,T,G,C
    my $refValid = CheckAllelesInSequence(\@refSeq);
    my $altValid = CheckAllelesInSequence(\@altSeq);
    if (!$refValid || !$altValid) {
        $err .= " Invalid ref '$oRef'." if (!$refValid);
        $err .= " Invalid alt '$oAlt'." if (!$altValid);
        $err =~ s/^\s*//;

        return (0, "", "", $err);
    }


    # Make sure ref is correct for the position
    my $refWrong = 0;
    for my $i (0 .. $#refSeq) {
        my $eRefNt = $self->{_ref_nucs}->[$oPos-1+$i];
        my $oRefNt = @refSeq > 0 ? $refSeq[$i] : "";

        if ($oRefNt ne $eRefNt) {
            $err = "Wrong ref '$oRefNt' at pos $oPos, should be '$eRefNt'.";
            return (0, "", "", $err);
        }
    }

    # Don't need to convert SNP
    if (@refSeq == 1 && @altSeq == 1) {
        $err = "SNP";
        return ($oPos, $oRef, $oAlt, $err);
    }

    my ($newRef1, $newAlt1, $numRightTrims) = $self->TrimRight($oRef, $oAlt);
    print "\nRight trim: trimed $numRightTrims nts\n" if ($debug);
    print "ref $newRef1\n" if ($debug);
    print "alt $newAlt1\n" if ($debug);

    my ($newRef, $newAlt, $numLeftTrims) = $self->TrimLeft($newRef1, $newAlt1);
    print "\nLeft trim: trimed $numLeftTrims nts\n" if ($debug);
    print "ref $newRef\n" if ($debug);
    print "alt $newAlt\n" if ($debug);

    my %wrongMuts = ();

    my $isIns = 0;
    my $bud = "";
    if    (!$newRef && $newAlt) {
        $isIns = 1;
        $bud = $newAlt;
    }
    elsif ($newRef && !$newAlt) {
        $isIns = 0;
        $bud = $newRef;
    }
    elsif ($newRef && $newAlt) {
        if (length($newRef) == 1 && length($newAlt) == 1) {
            $err = "SNP";
            print "\nERROR: mutation ref = $oRef alt = $oAlt is a SNP\n" if ($debug);
            my $mutPos = $oPos + $numLeftTrims;
            return ($mutPos, $newRef, $newAlt, $err);
        }
        else {
            print "\nERROR: mutation ref = $oRef alt = $oAlt is not valid\n" if ($debug);
            return (0, $newRef, $newAlt, "Invalid mutation");
        }
    }
    elsif (!$newRef && !$newAlt) {
        print "\nERROR: mutation ref = $oRef alt = $oAlt is not valid: ref = alt\n" if ($debug);
        return (0, "", "", "Empty mutation");
    }

    my ($mutRef, $mutAlt, $mutPos) = $self->Blossom($oPos+$numLeftTrims, $bud, $debug);

    my $outRef = $mutRef;
    my $outAlt = $mutAlt;
    if ($isIns) {
	$outRef = $mutAlt;
	$outAlt = $mutRef;
    }

    # COV-601: Modify SPDI to avoid using empty ref and alt
    if (!$outRef && $mutPos > 1) {
        $mutPos--;
        my $prevNuc = $self->{_ref_nucs}->[$mutPos-1];
        $outRef = $prevNuc;
        $outAlt = "$prevNuc$outAlt";
    }

    if (!$outAlt) {
        my $refLen = length($outRef);
        if ($mutPos && $mutPos + $refLen < $self->{_genome_len}) {
            my $nextNuc = $self->{_ref_nucs}->[$mutPos+$refLen-1];
            $outRef .= $nextNuc;
            $outAlt = $nextNuc;
        }
    }

    my $outPos = $mutPos;
    print "\nFinal indel call:\n" if ($debug);
    print "ref $oRef\nalt $oAlt\npos $oPos\n\tto\n" if ($debug);
    print "ref $outRef\nalt $outAlt\npos $outPos\n" if ($debug);

    return ($outPos, $outRef, $outAlt, $err);
}

# Implement the SPDI Blossom algorithm
sub Blossom
{
    my ($self, $oPos, $bud, $debug) = @_;

    my @budNts = split //, $bud;
    my $budLen = @budNts;

    print "Blossoming bud $bud at position $oPos\n" if ($debug);
    my $newRef = $bud;
    my $newAlt = "";

    my $done = 0;
    my $pos = $oPos + $budLen;

    while (!$done) {
        for my $i (0 .. $budLen-1) {
            if ($pos-1 > $self->{_genome_len}-1) {
                $done = 1;
                last;
            }

            my $seqNt = $self->{_ref_nucs}->[$pos-1];
            my $budNt = $budNts[$i];

            print "pos $pos $seqNt : $budNt\n" if ($debug);
            if ($seqNt eq $budNt) {
                $newRef .= $seqNt;
                $newAlt .= $seqNt;
            }
            else {
                $done = 1;
                last;
            }

            $pos++;
        }
    }

    print "new ref $newRef\n" if ($debug);
    print "new alt $newAlt\n" if ($debug);
    print "pos $pos\n" if ($debug);

    print "\nBlossoming to the left\n" if ($debug);
    $done = 0;
    $pos = $oPos-1;

    while (!$done) {
        for my $i (0 .. $budLen-1) {
            if ($pos < 1) {
                $done = 1;
                last;
            }

            my $seqNt = $self->{_ref_nucs}->[$pos-1];
            my $budNt = $budNts[$#budNts-$i];

            print "pos $pos $seqNt : $budNt\n" if ($debug);
            if ($seqNt eq $budNt) {
                $newRef = "$seqNt$newRef";
                $newAlt = "$seqNt$newAlt";
            }
            else {
                $done = 1;
                last;
            }

            $pos--;
        }
    }

    print "\nnew ref $newRef\n" if ($debug);
    print "new alt $newAlt\n" if ($debug);
    print "pos $pos\n" if ($debug);

    my $newPos = $pos + 1;

    return ($newRef, $newAlt, $newPos);
}

# Trim ref and alt from left
sub TrimLeft
{
    my ($self, $oRef, $oAlt, $debug) = @_;

    return ($oRef, $oAlt, 0) if (!$oRef || !$oAlt);

    my @refSeq = split //, $oRef;
    my @altSeq = split //, $oAlt;

    # Case 1: normal case
    # ABCD
    # AB

    # Case 2: CD/E, not a valid indel
    # ABCD
    # ABE

    # Case 3: C/D, a SNP
    # ABC
    # ABD

    # Case 4: ./., not a mutation
    # ABC
    # ABC


    my $done = 0;
    my $lPos = 0;
    while (!$done) {
	if ($lPos > $#refSeq || $lPos > $#altSeq) {
	    $done = 1;
	}
	else {
	    print "left pos $lPos ref '$refSeq[$lPos]' alt '$altSeq[$lPos]'\n" if ($debug);

	    if ($refSeq[$lPos] ne $altSeq[$lPos]) {
		$done = 1;
		print "done $done quiting\n" if ($debug);
	    }
	    else {
		$lPos++;
		print "checking pos $lPos\n" if ($debug);
	    }
	}
    }

    if ($debug) {
	my $nRef = $lPos > $#refSeq ? "" : $refSeq[$lPos];
	my $nAlt = $lPos > $#altSeq ? "" : $altSeq[$lPos];
	print "Left pos $lPos ref '$nRef' alt '$nAlt'\n";
    }

    my $newRef = "";
    for my $pos ($lPos .. $#refSeq) {
	$newRef .= $refSeq[$pos];
    }

    my $newAlt = "";
    for my $pos ($lPos .. $#altSeq) {
	$newAlt .= $altSeq[$pos];
    }

    return ($newRef, $newAlt, $lPos);
}

# Trim ref and alt from right
sub TrimRight
{
    my ($self, $oRef, $oAlt, $debug) = @_;

    my @refSeq = split //, $oRef;
    my @altSeq = split //, $oAlt;

    my $done = 0;
    my $rPos = 0;
    while (!$done) {
        if ($rPos > $#refSeq || $rPos > $#altSeq) {
            $done = 1;
        }
        else {
            print "right pos $rPos ref $refSeq[$#refSeq-$rPos] alt $altSeq[$#altSeq-$rPos] done $done\n" if ($debug);

            if ($refSeq[$#refSeq-$rPos] ne $altSeq[$#altSeq-$rPos]) {
                $done = 1;
                print "done $done quiting\n" if ($debug);
            }
            else {
                $rPos++;
            }
        }
    }
    print "right pos $rPos ref $refSeq[$#refSeq-$rPos] alt $altSeq[$#altSeq-$rPos]\n" if ($debug);

    my $newRef = "";
    for my $pos (0 .. $#refSeq - $rPos) {
	$newRef .= $refSeq[$pos];
    }

    my $newAlt = "";
    for my $pos (0 .. $#altSeq - $rPos) {
	$newAlt .= $altSeq[$pos];
    }

    return ($newRef, $newAlt, $rPos);
}

sub CheckAllelesInSequence
{
    my ($nucSeqRef) = @_;

    my %alleles = ("A" => "T", "T" => "A", "G" => "C", "C" => "G");
    my @nucSeq = @$nucSeqRef;

    my $valid = 1;

    for my $nuc (@nucSeq) {
	unless ($alleles{$nuc}) {
	    $valid = 0;
	    last;
	}
    }

    return $valid;
}

sub GetRefSequence
{
    my $refSeq = "";

    return $refSeq;
}

1;
